import React from 'react';
import {Grid} from "@material-ui/core";
import Box from '@material-ui/core/Box';
import {Formik, Form, Field} from 'formik';
import {
  Button,
  LinearProgress,
  MenuItem,
  FormControl,
  InputLabel,
  FormControlLabel,
  Typography,
} from '@material-ui/core';
import MuiTextField from '@material-ui/core/TextField';
import {
  fieldToTextField,
  TextField,
  TextFieldProps,
  Select,
  Switch,
} from 'formik-material-ui';




const Profile = () => {
  return (
  <div className="profile">
      <Formik
       initialValues = {{firstname: ''}} 
       onSubmit = {data =>{
        console.log(data);

        }}>

        {({values, handleChange, handleBlur, handleSubmit}) =>(
          <form onSubmit = {handleSubmit}>
             <Grid container spacing={3}>
          <Grid item xs={6} >
          <Box  margin={1}>
            <TextField 
            name = "firstName"
            label="First Name"
            type = "text"
            value = {values.firstname} 
            onChange = {handleChange} 
            onBlur = {handleBlur}
            />
            </Box>
            <pre>{JSON.stringify(values,null,2)}</pre>
          </Grid>

          <Grid item xs={6} >
            <TextField 
            name = "lastName"
            label="Last Name"
            type = "text"
            value = {values.firstname} 
            onChange = {handleChange} 
            onBlur = {handleBlur}
            />
            <pre>{JSON.stringify(values,null,2)}</pre>
            </Grid>

            <Grid item xs={6} >
            <TextField 
            name = "email"
            label="Email Address"
            type = "text"
            helperText="Please Enter Email"
            value = {values.firstname} 
            onChange = {handleChange} 
            onBlur = {handleBlur}
            />
            <pre>{JSON.stringify(values,null,2)}</pre>
          </Grid>

          <Grid item xs={6} >
            <TextField 
            name = "username"
            label="Username"
            type = "text"
            value = {values.firstname} 
            onChange = {handleChange} 
            onBlur = {handleBlur}
            />
            <pre>{JSON.stringify(values,null,2)}</pre>
            </Grid>



            <Grid item xs={6} >
            <Box margin={1}>
            
          </Box>
            <pre>{JSON.stringify(values,null,2)}</pre>
          </Grid>

          <Grid item xs={6} >
            <TextField 
            name = "username"
            label="Uname"
            type = "text"
            value = {values.firstname} 
            onChange = {handleChange} 
            onBlur = {handleBlur}
            />
            <pre>{JSON.stringify(values,null,2)}</pre>
            </Grid>



            </Grid>
          </form>
      )}
     </Formik>
    </div>
  );
};

export default Profile;
